import React from 'react';
import styled from 'styled-components';
import { HeadText } from './WayToCome';
import { Hr } from './Calender';

export default function Contact() {
  return (
    <>
      <ContactWrapper>
        <HeadText>마음 전하실 곳</HeadText>
        <Hr />
        <GroomtCover>
          <GroomText>신랑측</GroomText>
        </GroomtCover>
        <BridaltCover>
          <BridalText>신부측</BridalText>
        </BridaltCover>
      </ContactWrapper>
    </>
  );
}

export const ContactWrapper = styled.div`
  width: 100%;
  background-color: #fefbf8;
  padding-top: 4rem;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

export const GroomtCover = styled.div`
  width: 16rem;
  height: 3.5rem;
  background-color: #e6e7dd;
`;

export const GroomText = styled.p``;

export const BridaltCover = styled.div`
  width: 16rem;
  height: 3.5rem;
  background-color: #efeae2;
  margin-top: 1rem;
`;

export const BridalText = styled.p``;
